import React from 'react'

const BookCard = (props) => {
    return (
        <div>
            <img src={props.book.volumeInfo.imageLinks.thumbnail} alt="books"/>

            <h2>{props.book.volumeInfo.title}</h2>
        </div>
    )
}

export default BookCard
